import React from 'react';
import ReactDOM from 'react-dom';
import ArticleHeader from './components/ArticleHeader/index.js';
import ImageComponent from './components/ArticleHeader/index.js';

var data = {
	data: {
			// imageUrl: 'https://www.lordabbett.com/content/lordabbett/en/perspectives/marketview/time-rethink-your-approach-dividend-stocks/_jcr_content/parsys_right_1/everything/image.img.jpg/1570456295355.jpg',
			imageUrl: 'https://www.lordabbett.com/content/dam/lordabbett/en/images/topics/Economy-US/Economy-Recession-Puzzle-shutterstock_333096830.jpg',
			objectFitType: 'cover',
			altText: 'image3',
		}
};



				
var xmlhttp = new XMLHttpRequest();
var url = "http://localhost:4502/content/lordabbett/data.json";


function myFunction(json) {
  
  var obj = JSON.parse(json);
   //data=obj;
   ReactDOM.render(<ImageComponent  {...data} />, document.getElementById('root'));
}


xmlhttp.onreadystatechange = function() {
  if (this.readyState == 4 && this.status == 200) {   
    myFunction(this.responseText);
  }
};
xmlhttp.open("GET", url, true);
xmlhttp.send();
